const Card =() =>{
    return(
        <div className='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img className='w-30 ' alt ='grass' src={img}/>
            <div>
                <h2>Grass1</h2>
                <p>10</p>
            </div>
        </div>
    )
}

